INSERT INTO `nideshop_goods_attribute` VALUES (1,1006002,1,'100%棉'),(2,1006002,2,'1.5米+1.8米通用'),(3,1006002,3,'4件'),(4,1006002,4,'刺绣'),(5,1006002,5,'GB18401-2010 B类'),(6,1006002,6,'中国'),(7,1006002,7,'纺织品经历印染、织造等多道环节，产品初次拿到可能有些许味道，清水漂洗、晾干后味道即可散去。\n严选面料全部经过国标检测认证，选用环保活性染料，请放心使用。'),(8,1006007,8,'2000g/2300g'),(9,1006007,9,'200*230cm/220*240cm'),(10,1006007,10,'100%棉'),(11,1006007,11,'100%羊毛'),(12,1006007,7,'1.经过碳化、清洗、梳理的天然羊毛被带会有少量味道，通风晾晒2-3天即可散去                     2.为减少羊毛漂白等化学用品的处理时间，部分羊毛可能未完全脱色，轻微泛黄属羊毛原色，为正常现象。'),(13,1006010,8,'2000g/2300g'),(14,1006010,9,'200*230cm/220*240cm'),(15,1006010,10,'100%棉'),(16,1006010,11,'超细羊毛'),(17,1006010,7,'1.经过碳化、清洗、梳理的天然羊毛被带会有少量味道，通风晾晒2-3天即可散去                                        2.为减少羊毛漂白等化学用品的处理时间，部分羊毛可能未完全脱色，轻微泛黄属羊毛原色，为正常现象。'),(18,1006013,9,'200*230cm/ 220*240cm'),(19,1006013,10,'100%棉'),(20,1006013,11,'100%双宫茧桑蚕丝'),(21,1006013,8,'0.5KG/1KG'),(22,1006013,7,'天然桑蚕丝具有正常蛋白味道，通风晾晒2-3天即可散去'),(23,1006014,9,'200*230cm/ 220*240cm'),(24,1006014,10,'100%棉'),(25,1006014,11,'100%双宫茧桑蚕丝'),(26,1006014,8,'0.5+1.5KG/1+2KG'),(27,1006014,7,'天然桑蚕丝具有正常蛋白味道，通风晾晒2-3天即可散去'),(28,1009009,9,'200*230cm/220*240cm'),(29,1009009,12,'白鹅绒'),(30,1009009,13,'60%棉 40%聚酯纤维'),(31,1009009,8,'1500g/1700g'),(32,1009009,14,'95%'),(33,1009009,4,'双层立衬'),(34,1009012,9,'48*74cm'),(35,1009012,13,'100%棉'),(36,1009012,12,'100%聚酯纤维'),(37,1009012,15,'1000g'),(38,1009012,6,'中国'),(39,1009012,7,'枕芯类商品受身高、体型、睡眠习惯不同，产生不同的使用体验，建议多试睡几款枕头，挑选最适合的进行使用。'),(40,1009013,9,'48*74cm'),(41,1009013,13,'70%高模量聚酯+30%聚酰胺'),(42,1009013,12,'100%聚酯纤维'),(43,1009013,15,'1000g'),(44,1009013,6,'中国'),(45,1009013,7,'枕芯类商品受身高、体型、睡眠习惯不同，产生不同的使用体验，建议多试睡几款枕头，挑选最适合的进行使用。'),(46,1009024,16,'65*65*43cm'),(47,1009024,17,'外套帆布：100%棉；外套弹力布：锦纶80%氨纶20%'),(48,1009024,18,'内胆面料：100%锦纶；填充物：聚苯乙烯（发泡粒子）'),(49,1009024,19,'本品为人工填充粒子，重量难免会有误差，敬请谅解。同时产品在运输过程中受挤压，也可能会造成凹陷。储存时请避免重物挤压以引起泡沫粒子塌陷。'),(50,1010000,1,'100%羊毛'),(51,1010000,9,'200*150cm'),(52,1010000,7,'1.羊毛毯采取传统机织工艺，纯天然织造的，直接接触皮肤会有轻微扎人。\n2.初次使用时会有少量浮毛，建议干洗处理。\n3.商品为纯羊毛织造而成，若有少量气味请通风2-3天去除。'),(53,1010001,1,'100%羊毛'),(54,1010001,16,'200*150cm'),(55,1010001,7,'1.羊毛毯采取传统机织工艺，纯天然织造的，直接接触皮肤会有轻微扎人。\n2.初次使用时会有少量浮毛，建议干洗处理。\n3.商品为纯羊毛织造而成，若有少量气味请通风2-3天去除。'),(56,1011004,13,'100% 棉'),(57,1011004,20,'GB18401-2010 B类'),(58,1011004,16,'150×200cm'),(59,1011004,21,'一等品'),(60,1011004,6,'中国'),(61,1011004,15,'1800g'),(62,1011004,7,'1.深色纯棉毛巾被在织造染色过程中，巾面更易产生微细的纤维浮绒，使用前建议用清水漂洗1-2次，即可去掉产品上的浮绒。\n2.在洗涤时一定要注意不要与衣服混在一起机洗，强力的搓洗会引起掉毛或勾线现象。\n3.纺织品经历印染、织造等多道环节，产品初次拿到可能有些许味道，清水漂洗、晾干后味道即可散去。严选面料全部经过国标检测认证，选用环保活性染料，请放心使用。'),(63,1015007,9,'45cm*45cm'),(64,1015007,22,'100%全棉'),(65,1015007,23,'100%全棉'),(66,1015007,11,'100%聚酯纤维'),(67,1015007,15,'470g（内芯）'),(68,1015007,6,'中国'),(69,1019000,12,'聚醚型聚氨酯'),(70,1019000,13,'100%聚酯纤维'),(71,1019000,9,'50cm×30cm×9cm-7cm'),(72,1019000,24,'白色'),(73,1019000,25,'单人'),(74,1019000,7,'1.记忆绵产品为进口环保化学材质聚氨酯发泡而成，刚打开包装会有少量聚氨酯气体产生，拆除外套通风除味3-5天即可。                                                                                  2.枕芯类商品受身高、体型、睡眠习惯不同，产生不同的使用体验，建议多试睡几款枕头，挑选最适合的进行使用。'),(75,1019001,12,'聚醚型聚氨酯'),(76,1019001,13,'100%聚酯纤维'),(77,1019001,9,'50cm×30cm×10cm-6cm'),(78,1019001,24,'白色'),(79,1019001,25,'单人'),(80,1019001,7,'1.记忆绵产品为进口环保化学材质聚氨酯发泡而成，刚打开包装会有少量聚氨酯气体产生，拆除外套通风除味3-5天即可。 2.枕芯类商品受身高、体型、睡眠习惯不同，产生不同的使用体验，建议多试睡几款枕头，挑选最适合的进行使用。'),(81,1019002,12,'聚醚型聚氨酯'),(82,1019002,13,'聚酯纤维'),(83,1019002,9,'135cm×36cm×10cm-7cm'),(84,1019002,24,'白色'),(85,1019002,25,'双人'),(86,1019002,7,'1.记忆绵产品为进口环保化学材质聚氨酯发泡而成，刚打开包装会有少量聚氨酯气体产生，拆除外套通风除味3-5天即可。 \n2.枕芯类商品受身高、体型、睡眠习惯不同，产生不同的使用体验，建议多试睡几款枕头，挑选最适合的进行使用。'),(87,1019006,13,'100%棉'),(88,1019006,12,'20% 夜交藤+80% 聚酯纤维'),(89,1019006,9,'48*74cm'),(90,1019006,24,'白色'),(91,1019006,25,'单人'),(92,1019006,7,'1.植物填充，遇梅雨季节需要通风、干燥保存。 \n2.枕芯类商品受身高、体型、睡眠习惯不同，产生不同的使用体验，建议多试睡几款枕头，挑选最适合的进行使用。'),(93,1020000,12,'聚氨酯'),(94,1020000,13,'100%棉'),(95,1020000,9,'33cm×31cm×10cm'),(96,1020000,24,'灰色条纹/粉色条纹'),(97,1021004,1,'100%羊毛'),(98,1021004,9,'150*200cm'),(99,1021004,21,'一等品'),(100,1021004,6,'中国'),(101,1021004,7,'1.羊毛毯采取传统机织工艺，纯天然织造的，直接接触皮肤会有轻微扎人。\n2.初